import React from 'react';
import { Box, Typography, Button, Container } from '@mui/material';

const HeroSection = () => {
  return (
    <Box
      sx={{
        minHeight: '80vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#FFFFFF',
        py: 8,
      }}
    >
      <Container maxWidth="md">
        <Typography
          variant="h1"
          gutterBottom
          sx={{ fontSize: { xs: '2rem', md: '2.5rem' }, mb: 3 }}
        >
          Elevate Your Career and Business with Hono Technology
        </Typography>
        <Typography variant="h5" sx={{ mb: 4, fontSize: { xs: '1rem', md: '1.25rem' } }}>
          Partnered with Zvertex AI, we deliver cutting-edge IT solutions to empower individuals and businesses for success.
        </Typography>
        <Button
          variant="contained"
          size="large"
          href="https://zvertexai.com"
          target="_blank"
        >
          Learn More
        </Button>
      </Container>
    </Box>
  );
};

export default HeroSection;
